import { makeStyles } from "@mui/styles";


export const useStyles = makeStyles({
  text:{
    '& p':{
      fontSize:20
    },
    marginBottom:38
  },
  container:{
    padding:87,
    marginRight:32,
  },
  img:{
    float:'left',
    height:50,
    '& img':{
      float:'bottom'
    }
  },
  bottomText:{
    textAlign:'start'
  }
})
